script: |
  super -f text -I q10290.spq | sort > q10290.out

inputs:
  - name: q10290.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 / + col2 - + - col0 + - + col2 NOT BETWEEN + + col2 AND - col0 + col1;
  - name: tab1

outputs:
  - name: q10290.out
    data: |
      51	14	96
      85	5	59
      91	47	68
